package AEIN14__Longest_Common_Prefix;



class Solution {
    public static String longestCommonPrefix(String[] strs) {
        String prefix = "";
        String s1;
        String s2;
        if(strs.length == 0){
            return "";
        }else if(strs.length == 1){
            return strs[0];
        }else{


            for(int j = 0; (j < strs[0].length()) && (j < strs[1].length()); j++){
                if (strs[0].charAt(j) == strs[1].charAt(j)){
                    prefix = prefix + strs[0].charAt(j);
                }else {
                    break;
                }
            }
        }

        for(int i = 2; (i < strs.length) && !(prefix.equals("")) ; i++){
            if(strs[i].startsWith(prefix)){
                continue;
            }else{
                prefix = prefix.substring(0,prefix.length()-1);
                while(!prefix.equals("")){
                    if (strs[i].startsWith(prefix)){
                        break;
                    }else{
                        prefix = prefix.substring(0,prefix.length()-1);
                    }
                }
            }
        }
        return prefix;
    }


//take 1st word
//compare it to the next one
//get common prefix
//start comparing this prefix with other words and take down


    public static void main(String[] args) {
        System.out.println(longestCommonPrefix(new String[]{"flower","flow","flight"}));

        System.out.println(longestCommonPrefix(new String[]{"dog","racecar","car"}));
    }
}

